import { Container } from './styled'
import 'semantic-ui-css/semantic.min.css'

export class CrudFuncionarios extends Component {


  render() {
    return (
      <Container>

        <div class="ui card">
          <div class="image"><img src="https://i.pinimg.com/564x/eb/ca/a1/ebcaa107e84dbaa6f50392bb7050c3b8.jpg" />
          </div>
          <div class="content">
            <div class="header">Jo√£o Marcos</div>
            <div class="meta">Financeiro</div>

            <div class="description">Horas Mes: 85h.</div>
          </div><div class="extra content"><a><i aria-hidden="true" class="user icon">
          </i>Saldo de Horas: 5.</a>
          </div>
        </div>







      </Container>
    );
  }
}

export class CrudNovoFuncionarios extends Component {


  render() {
    return (
      <Container>



        <div class="ui card">
          <div class="image"><img src="https://www.lrcb.nl/resources/uploads/2017/09/unknown_person-1024x1024-300x300.png" />
          </div>
          <div class="content">
            <div class="header">Novo Funcionario</div>
            <div class="meta">Setor</div>

            <div class="description">Horas Mes: 00h.</div>
          </div>
          <div class="extra content"><a><i aria-hidden="true" >
          </i><div>
              <button class="ui animated button"><div class="visible content">Cadastrar</div><div class="hidden content"><i aria-hidden="true" class="arrow right icon"></i></div></button>
            </div></a>
          </div>
        </div>





      </Container>
    );
  }
}
